[{"location":"","page":"-","title":"-","text":"CurrentModule = Main.OurModuleName\r\nDocTestSetup = quote\r\n    println(\"hi!\")\r\n    using Main.OurModuleName\r\nend","category":"page"},{"location":"","page":"-","title":"-","text":"Modules = [Main.OurModuleName]","category":"page"},{"location":"#Main.OurModuleName.MP-Tuple{Array{<:Union{Integer, Rational}}, Array{<:Union{Integer, Rational}}}","page":"-","title":"Main.OurModuleName.MP","text":"MP(y, z)\n\nCompute the middle product of polynomials y and z.\n\nFor vectors y = y_1y_n and z = z_1z_2n-1 of polynomial coefficients, return c_n-1 c_2n-1, where c_k = sum_i + j = k a_i b_j.\n\nExamples\n\njulia> Main.OurModuleName.MP([4, 6, 38, -1], [1, 2, 3, 4, 8, 9, 26, 7])\n4-element Vector{Int64}:\n 109\n 168\n 233\n 458\n\njulia> Main.OurModuleName.MP([-7//10, 1, -2], [9//4, -1//4, -2//5, 9//8, -4//9, -1//2])\n3-element Vector{Rational{Int64}}:\n -447//100\n  -11//16\n  161//72\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.compute_Δ-Union{Tuple{S}, Tuple{T}, Tuple{T, S}} where {T<:Integer, S<:Integer}","page":"-","title":"Main.OurModuleName.compute_Δ","text":"compute_Δ(a, d)\n\nCompute the Δ function from lemma 2 in BGS07.\n\nFor a degree d and shift a  d, return a vector Δ_0 Δ_d, where Δ_i = prod_j = 0^d (a + i - j).\n\nExample\n\njulia> Main.OurModuleName.compute_Δ(5, 3)\n4-element Vector{BigInt}:\n  120\n  360\n  840\n 1680\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.compute_δ-Tuple{T} where T<:Integer","page":"-","title":"Main.OurModuleName.compute_δ","text":"compute_δ(d)\n\nCompute dfrac1δ where δ is the function from lemma 2 in BGS07.\n\nFor a degree d, return a vector leftdfrac1δ_0 dfrac1δ_dright, where δ_i = prod_j = 0 j neq i^d (i - j).\n\nExample\n\njulia> Main.OurModuleName.compute_δ(5)\n6-element Vector{Rational{BigInt}}:\n -1//120\n  1//24\n -1//12\n  1//12\n -1//24\n  1//120\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.lagrange-Union{Tuple{T2}, Tuple{T1}, Tuple{Vector{T1}, T2}} where {T1<:Union{Integer, Rational}, T2<:Integer}","page":"-","title":"Main.OurModuleName.lagrange","text":"lagrange(p, a)\n\nLagrange interpolate a vector p of polynomial outputs to a new position a.\n\nFor a polynomial P, apply Lagrange interpolation to the values p = P(0) P(1)  P(d) to produce a vector of shifted values P(a) P(a + 1)  P(a + d).\n\nExample\n\njulia> Main.OurModuleName.lagrange([1//4, -7//4, -31//4], 3)\n3-element Vector{Rational{Int64}}:\n  -71//4\n -127//4\n -199//4\n\n\n\n\n\n","category":"method"},{"location":"#Main.OurModuleName.lagrange_matrix-Union{Tuple{Array{T, 3}}, Tuple{T}} where T<:Union{Integer, Rational}","page":"-","title":"Main.OurModuleName.lagrange_matrix","text":"lagrange_matrix(A)\n\nLagrange interpolate all entries of a list of d+1 matrices and return 3(d+1) matrices\n\nApply the following to each entry of the matrices, with a = d+1 2d+1 3d+1: For a polynomial P, apply Lagrange interpolation to the values p = P(0) P(1)  P(d) to produce a vector of shifted values P(a) P(a + 1)  P(a + d).\n\nExample\n\njulia> Main.OurModuleName.lagrange_matrix([0:2 3:5 6:8 ;;; 9:11 12:14 15:17])\n3×3×6 Array{Int64, 3}:\n[:, :, 1] =\n 18  21  24\n 19  22  25\n 20  23  26\n\n[:, :, 2] =\n 27  30  33\n 28  31  34\n 29  32  35\n\n[:, :, 3] =\n 36  39  42\n 37  40  43\n 38  41  44\n\n[:, :, 4] =\n 45  48  51\n 46  49  52\n 47  50  53\n\n[:, :, 5] =\n 54  57  60\n 55  58  61\n 56  59  62\n\n[:, :, 6] =\n 63  66  69\n 64  67  70\n 65  68  71\n\n\n\n\n\n","category":"method"}]
